.2rem;\r\n  font-weight: 600;\r\n  letter-spacing: 0.15em;\r\n  text-transform: uppercase;\r\n  color: #666;\r\n}\r\n\r\n.section--title {\r\n  text-align: center;\r\n  font-size: 3.2em;\r\n  font-weight: 300;\r\n  margin: 0 0 6.4rem;\r\n  position: relative;\r\n}\r\n.section--title::after {\r\n  content: '''';\r\n  background: #8bc2ef;\r\n  bottom: -1.6rem;\r\n  display: block;\r\n  height: 3px;\r\n  width: 60px;\r\n  position: absolute;\r\n  left: 50%;\r\n  margin-left: -30px;\r\n}\r\n\r\n.section--description p {\r\n  font-size: 2rem;\r\n}\r\n.section--description p:last-of-type {\r\n  margin-bottom: 0;\r\n}\r\n\r\n@media screen and (max-width: 767px) {\r\n  .section, .content-3, .content-4, .content-5, .content-6, .blog-2, .portfolio-1, .clients-1, .testimonials-1, .skills-1, .timeline-1 {\r\n    padding: 6.4rem 0;\r\n  }\r\n\r\n  .screen, .header-1, .header-1 .container {\r\n    height: 100vh;\r\n    min-height: 480px;\r\n  }\r\n\r\n  .section--name {\r\n    font-size: 1.6rem;\r\n  }\r\n\r\n  .section--title {\r\n    font-size: 3.2rem;\r\n    margin-bottom: 4.8rem;\r\n  }\r\n\r\n  .section--description p {\r\n    font-size: 1.6rem;\r\n  }\r\n}\r\n/**************************************************************************/\r\n/* FLEX GRID */\r\n/**************************************************************************/\r\n.flex-grid {\r\n  display: flex;\r\n  flex-flow: wrap;\r\n  justify-content: space-between;\r\n  align-content: flex-start;\r\n  margin: 0 -15px;\r\n}\r\n\r\n.flex-grid--item {\r\n  flex: 1 0 auto;\r\n  font-size: 1.6rem;\r\n  padding: 0;\r\n  margin: 0 15px;\r\n  align-self: stretch;\r\n  width: calc(100% - 30px);\r\n  position: relative;\r\n  margin-bottom: 30px;\r\n}\r\n\r\n@media only screen and (max-width: 767px) {\r\n  .flex-grid--item:nth-of-type(4n) {\r\n    margin-bottom: 0;\r\n  }\r\n}\r\n@media only screen and (min-width: 768px) {\r\n  .flex-grid--item {\r\n    flex: 1 0 calc(50% - 30px);\r\n  }\r\n  .flex-grid--item:nth-of-type(3n)