(17, 2, 'Header 0', 'header1.png', '<section class="screen home-v1" style="background-image: (<?php echo esc_url(get_theme_mod(''tg-header-1-background-image'')) ?>)">\r\n    <header class="hdr-v1">\r\n        <div class="container">\r\n            <div class="row">\r\n                <div class="col-md-3">\r\n                    <h1 class="logo header-font">\r\n                        <a href="<?php echo home_url(); ?>" class="primary">\r\n                            <?php if (get_theme_mod(''tg-site-logo-image'')): ?>\r\n                                <img src="<?php echo esc_url(get_theme_mod(''tg-site-logo-image'')) ?>" alt="<?php bloginfo(''name''); ?>" />\r\n                            <?php endif; ?>\r\n                            <?php if (''blank'' != get_theme_mod(''header_textcolor'')): ?>\r\n                                <?php bloginfo(''name''); ?>\r\n                            <?php endif; ?>\r\n                        </a>\r\n                    </h1>\r\n                </div>\r\n                <div class="col-md-9">\r\n                    <nav class="prim-nav">\r\n                        <?php\r\n                        wp_nav_menu(array(\r\n                            ''theme_location'' => ''main-menu'',\r\n                            ''container'' => '''',\r\n                            ''menu_class'' => ''inline'',\r\n                        ));\r\n                        ?>\r\n                    </nav>\r\n                </div>\r\n            </div>\r\n        </div>\r\n    </header>\r\n\r\n    <div class="container">\r\n        <div class="row">\r\n\r\n            <div class="vertical">\r\n\r\n                <div class="intro col-xs-12 col-sm-10 col-md-<?php echo get_theme_mod(''tg-header-1-text-text-width''); ?>" >\r\n                    <h2 class="page-intro border header-font">\r\n                        <?php echo get_theme_mod(''tg-header-1-text-title''); ?>\r\n                    </h2>\r\n\r\n                    <p class="page-description secondary">\r\n                        <?php echo get_theme_mod(''tg-header-1-text-description''); ?>\r\n                    </p>\r\n\r\n                    <p>\r\n                        <?php if (get_theme_mod(''tg-header-1-buttons-button-visibility'') == ''1''): ?>\r\n                            <a href="<?php echo get_theme_mod(''tg-header-1-buttons-button-url''); ?>"\r\n                               id="hdr-btn-1"\r\n                               class="btn btn-lg <?php echo get_theme_mod(''tg-header-1-buttons-button-style''); ?>">\r\n                                <?php echo get_theme_mod(''tg-header-1-buttons-button-title''); ?>\r\n                            </a>\r\n                        <?php endif; ?>\r\n                    </p>\r\n                </div>\r\n\r\n            </div>\r\n\r\n        </div>\r\n    </div>\r\n</section>', 0, 'header-0', 'Header', '', 1438448768, '/**************************************************************************/\r\n/* HOME SCREEN */\r\n/**************************************************************************/\r\n/* line 133, ../scss/layout.scss */\r\n.home-v1 {\r\n  background: #333333 50% 50% no-repeat;\r\n  background-size: cover;\r\n  position: relative;\r\n  text-shadow: 0 0 2px rgba(0, 0, 0, 0.3);\r\n}\r\n.home-v1:before {\r\n    content: '''';\r\n    position: absolute;\r\n    left: 0;\r\n    top: 0;\r\n    display: block;\r\n    width: 100%;\r\n    height: 100%;\r\n    background: rgba(0, 0, 0, 0.3);\r\n}\r\n/* line 139, ../scss/layout.scss */\r\n.home-v1 h2 {\r\n  color: white;\r\n  font-weight: 300;\r\n}\r\n/* line 143, ../scss/layout.scss */\r\n.home-v1 p {\r\n  color: white;\r\n  font-size: 20px;\r\n}\r\n\r\n/**\r\n * ----------------------------------------------------------------------------------------\r\n * Form styles.\r\n * ----------------------------------------------------------------------------------------\r\n */\r\nform button,\r\nform input,\r\nform select,\r\nform textarea {\r\n    max-width: 100%; }\r\nform input[type="submit"],\r\nform input[type="button"] {\r\n    -webkit-font-smoothing: antialiased; }\r\n\r\n/**\r\n * ----------------------------------------------------------------------------------------\r\n * Buttons classes.\r\n *\r\n * Change default bootstrap colors & styles.\r\n * ----------------------------------------------------------------------------------------\r\n */\r\n.btn, form input[type="submit"],\r\nform input[type="button"] {\r\n    border-radius: 0;\r\n}\r\n\r\n.btn-ghost {\r\n    border: 1px solid #fff;\r\n    color: #fff;\r\n    text-transform: uppercase;\r\n    letter-spacing: 0.15em;\r\n    position: relative;\r\n}\r\n\r\n.btn-ghost:before {\r\n    content: '''';\r\n    position: absolute;\r\n    left: 0;\r\n    top: 0;\r\n    width: 100%;\r\n    height: 100%;\r\n    background: rgba(255, 255, 255, 0);\r\n    -moz-transition: all, 300ms, ease;\r\n    -o-transition: all, 300ms, ease;\r\n    -webkit-transition: all, 300ms, ease;\r\n    transition: all, 300ms, ease;\r\n}\r\n\r\n.btn-ghost:hover {\r\n    color: #fff;\r\n}\r\n\r\n.btn-ghost:hover:before {\r\n    background: rgba(255, 255, 255, 0.1);\r\n}\r\n\r\n.btn-ghost:active, .btn-ghost:focus {\r\n    color: #fff;\r\n}\r\n\r\n.btn-ghost-inverse {\r\n    border: 1px solid #222;\r\n    color: #222;\r\n    text-transform: uppercase;\r\n    letter-spacing: 0.15em;\r\n    position: relative;\r\n}\r\n\r\n.btn-ghost-inverse:before {\r\n    content: '''';\r\n    position: absolute;\r\n    left: 0;\r\n    top: 0;\r\n    width: 100%;\r\n    height: 100%;\r\n    background: transparent;\r\n    -moz-transition: all, 300ms, ease;\r\n    -o-transition: all, 300ms, ease;\r\n    -webkit-transition: all, 300ms, ease;\r\n    transition: all, 300ms, ease;\r\n}\r\n\r\n.btn-ghost-inverse:hover {\r\n    color: #222;\r\n}\r\n\r\n.btn-ghost-inverse:hover:before {\r\n    background: rgba(0, 0, 0, 0.1);\r\n}\r\n\r\n.btn-ghost-inverse:active, .btn-ghost-inverse:focus {\r\n    color: #222;\r\