      <?php tg_post_excerpt(''blog-1''); ?>\r\n                            <?php tg_post_date(''blog-1''); ?>\r\n                        </div>\r\n                    </div>\r\n                <?php endwhile; // while has_post(); ?>\r\n            <?php endif; // if has_post() ?>\r\n\r\n            <?php wp_reset_query(); ?>\r\n\r\n        </div>\r\n        <!-- end flex-grid-->\r\n\r\n        <?php if (get_theme_mod(''tg-blog-1-buttons-button-visibility'') == ''1''): ?>\r\n        <div class="row">\r\n            <div class="col-sm-12">\r\n                <p class="blog-1--action-wrapper">\r\n                    <a class="btn <?php echo get_theme_mod(''tg-blog-1-buttons-button-style'') ?>" href="<?php echo get_theme_mod(''tg-blog-1-buttons-button-url'') ?>" id="blog-1-btn"><?php echo get_theme_mod(''tg-blog-1-buttons-button-title'') ?></a>\r\n                </p>\r\n            </div>\r\n        </div>\r\n        <?php endif; // if get_theme_mod() ?>\r\n\r\n    </div>\r\n</section>', 1, 'blog-1', 'Blog 1', '', NULL, '.blog-1 {\r\n  background: #f5f5f5;\r\n}\r\n\r\n.blog-1--item {\r\n  background: #fff;\r\n  box-shadow: 0 1px 1px 0 rgba(0, 0, 0, 0.1);\r\n}\r\n.blog-1--item:hover {\r\n  box-shadow: 0 1px 1px 0 rgba(0, 0, 0, 0.2);\r\n}\r\n\r\n.blog-1--item-thumbnail-link {\r\n  display: block;\r\n  background: #222;\r\n}\r\n\r\n.blog-1--item-thumbnail {\r\n  width: 100%;\r\n  -webkit-transition: all .3s ease-in-out;\r\n          transition: all .3s ease-in-out;\r\n}\r\n.blog-1--item-thumbnail-link:hover .blog-1--item-thumbnail {\r\n  opacity: .8;\r\n}\r\n\r\n.blog-1--item-details {\r\n  padding: 15px;\r\n}\r\n\r\n.blog-1--item-tags {\r\n  position: relative;\r\n  margin: .8rem 0 2.4rem;\r\n  font-size: 1.2rem;\r\n  line-height: 1em;\r\n  text-transform: uppercase;\r\n}\r\n.blog-1--item-tags:after {\r\n  content: '''';\r\n  display: block;\r\n  width: 40px;\r\n  height: 2px;\r\n  position: absolute;\r\n  left: 0;\r\n  bottom: -.8rem;\r\n  background: #8bc2ef;\r\n}\r\n.blog-1--item-tags a {\r\n  color: #777;\r\n}\r\n\r\n.blog-1--item-title {\r\n  margin: 0 0 1.6rem;\r\n  font-size: 2rem;\r\n  font-weight: 700;\r\n}\r\n.blog-1--item-title a {\r\n  color: #222;\r\n}\r\n\r\n.blog-1--item-excerpt {\r\n  font-size: 1.4rem;\r\n  color: #444;\r\n}\r\n\r\n.blog-1--item-meta {\r\n  margin: 0;\r\n  color: #888;\r\n  font-size: 1.2rem;\r\n  font-weight: 700;\r\n}\r\n\r\n.blog-1--action-wrapper {\r\n  text-align: center;\r\n  margin: 0;\r\n  padding-top: 3.2rem;\r\n}');

